const NameItem = (props) => {
    return <div>{props.name}</div>
  }

const VoiceChannel = (props) => {

    let namesEl = props.namesData.map(n => <NameItem name={n.name} id={n.id} />)

    return (
        <div>
            {namesEl}
        </div>
    )
}

export default VoiceChannel;
